import React from 'react';
import {Button, CorrectedImage, LinkArrow} from "../../styles/common";
import {
  CartTitle,
  CartContent,
  CartContentInner,
  CartOrdersList,
  CartOrdersListItem,
  CartOrdersListItemInfoContainer,
  CartOrdersListItemImageContainer,
  CartSummaries,
  CartOrdersListItemTitleAndPrice,
  CartOrdersListItemBeforeDiscount,
  CartOrdersListItemQuantityContainer,
  CartOrdersListItemQuantityInput, CartOrdersListItemPriceWrapper, CartFormWrapper, CartFormField, CartFormInput,
} from "./styles";
import {ErrorMessage, Formik} from "formik";
import * as Yup from 'yup';

function Cart() {
  const total = 26;
  const discount = 14;

  const validationSchema = Yup.object().shape({
    fullName: Yup.string()
      .typeError('Must be a string')
      .required('Required'),
    email: Yup.string()
      .email('Email must be valid')
      .required('Required'),
  })

  return (
    <div>
      <CartTitle>Cart</CartTitle>
      <CartContent>
        <CartContentInner>
          <CartOrdersList>
            <CartOrdersListItem>
              <CartOrdersListItemInfoContainer>
                <CartOrdersListItemImageContainer>
                  <CorrectedImage src="./img/shop/mung-bean-1.png" alt="Product name"/>
                </CartOrdersListItemImageContainer>
                <CartOrdersListItemTitleAndPrice>
                  <a href="#" style={{color: 'inherit'}}>Zelco Suji Elaichi Rusk</a>
                  <CartOrdersListItemPriceWrapper>
                    <CartOrdersListItemBeforeDiscount>
                      <span>$</span>
                      <span style={{textDecoration: 'line-through', textDecorationThickness: '4px'}}>20.00</span>
                    </CartOrdersListItemBeforeDiscount>
                    <div>$13.00</div>
                  </CartOrdersListItemPriceWrapper>
                </CartOrdersListItemTitleAndPrice>
              </CartOrdersListItemInfoContainer>
              <CartOrdersListItemQuantityContainer>
                <div>Quantity:</div>
                <CartOrdersListItemQuantityInput type="number" onChange={e => {
                  if (e.target.value < 1) {
                    console.log(e.target.value);
                  }
                }}/>
                <Button type="button"
                        $color="#FFFFFF"
                        $backgroundColor={props => props.theme.colors.title}
                        $paddingY="1rem"
                        $paddingX="2rem"
                >X</Button>
              </CartOrdersListItemQuantityContainer>
            </CartOrdersListItem>
          </CartOrdersList>
          <CartSummaries>
            <div>Total Cost {total}$</div>
            <div>Discount {discount}$</div>
          </CartSummaries>
          <Button type="Button" $paddingX="3.2rem" $marginTop="4rem" $color="#FFFFFF"
                  $backgroundColor={props => props.theme.colors.title}>
            <div>To order</div>
            <LinkArrow>
              <img src="./img/common/arrow.svg" alt=""/>
            </LinkArrow>
          </Button>
          <CartFormWrapper>
            <Formik
              initialValues={{
                fullName: '',
                email: '',
                address: '',
                phone: '',
                message: '',
              }}
              validateOnBlur
              onSubmit={(values) => {
                console.log(values);
              }}
              validationSchema={validationSchema}

            >
              {({values, errors, touched, handleChange, handleBlur, isValid, handleSubmit, dirty}) => (
                <div>
                  <CartFormField>
                    <label htmlFor="fullName">Full Name*</label>
                    <CartFormInput
                      placeholder="Your Full Name"
                      type="text"
                      name="fullName"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.name}
                    />
                  </CartFormField>
                  <ErrorMessage name="fullName">
                    {msg => <div>{msg}</div>}
                  </ErrorMessage>
                  <Button
                    type='submit'
                    onClick={handleSubmit}
                    disabled={!isValid && !dirty}
                    $color="#FFFFFF"
                    $backgroundColor={props => props.theme.colors.title}
                    $paddingX="4.2rem"
                    $marginTop="5rem"
                  >Confirm</Button>
                </div>
              )}
            </Formik>
          </CartFormWrapper>
        </CartContentInner>
      </CartContent>
    </div>
  );
}

export default Cart;
